  const [loggedIn, setLoggedIn] = useState(false);
  const myRef = useRef(initialValue);

  return (
    <Router>
      <div>
        <h1>Authentication App</h1>
        <Routes>
          <Route path="/register" element={RegisterForm} />
          <Route path="/login">
            <LoginForm setLoggedIn={setLoggedIn} />
          </Route>
          <Route path="/" element={HomePage} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
